import { Card, FormControl } from '@material-ui/core';
import React from 'react';
import { Container, Form } from 'react-bootstrap';
const Return = () => {
    return (
        <div className="m-5">
        <Container>
            <Card>
                <Form>
                    <FormControl/>
                </Form>
            </Card>
        </Container>
        </div>
        );
}

export default Return;
